import React from "react";
import ReactDOM from "react-dom";
import AboutMe from "./components/aboutMe.jsx";
import "./styles/index.css";

let aboutText =
  "hello! I am a senior at the University of Pennsylvania and a proud alumnus of Central High school";

ReactDOM.render(<AboutMe about={aboutText} />, document.getElementById("root"));
